const Contact = () => {
    return (
      <section className="page" id="contact">
        <header className="App-header">
          <h3>
            Contact
          </h3>
        </header>
        <div className="content contact">
          <div className="subcontent">
            <p>Email: <span className="cLink">nels123159@gmail.com</span></p>
            <p>LinkedIn: <span className="cLink">https://www.linkedin.com/in/adam-nelson-b32324153/</span></p>
            <span className="cLink">Download Resume</span>
          </div>
        </div>
      </section>
    );
  }
  
  export default Contact;
